window.bookSummaryJSON = "<p>The stakes have never been higher, and she's full of the devil.</p> <p>Edward Fasbender is my husband. Together, we brought down powerful men. Now we have a chance to start over. To be the family neither of us ever had, to leave the past in the past where it belongs. Edward has a choice to make. It will decide if we fall into the flames - or rise together.</p> <p><i>Rising</i> is the fourth and final book in the Slay Quartet.</p>"; 
